import { SET_PLAN, SET_LISTA_PLANES } from "actions/types";
const initialState = {
  obraSocial: { cd_os: 0, nombre: "" },
  listaObrasSociales: [],
};

export default function (state = initialState, action) {
  switch (action.type) {
    case SET_OBRA_SOCIAL:
      return {
        ...state,
        obraSocial: action.payload,
      };
    case SET_LISTA_OBRA_SOCIAL:
      return {
        ...state,
        listaObrasSociales: action.payload,
      };

    default:
      return state;
  }
}
